def p2s(xy):
    x,y=xy
    if x<1 or x>8 or y<1 or y>8: return 'n/a'
    return chr(96+x)+str(y)

class piece():
    def __init__(self, col, tip, sq):
        self.col = col
        self.type = tip
        self.sq = sq
        self.x = ord(self.sq[0])-96
        self.y = int(self.sq[1])

    def __repr__(self):
        return self.col+self.type+'@'+self.sq
        
    def expand(self, board_state):
        rez = []
        if self.col =='w':
            oppcol = 'b'
        else:
            oppcol = 'w'
        
        if self.type == 'p':
            ztip = self.col+'p'
        else:
            ztip = 'a'+self.type

        if self.type == 'p':
            pdesignation = ''
        else:
            pdesignation = self.type.upper()
            
        preliminary = actmap[self.sq][ztip]
        for mv in preliminary['m']:
            if board_state[mv]=='  ':
                rez.append(('m',mv,pdesignation+mv))
        for mv in preliminary['m2']:
            if board_state[mv]=='  ' and ((self.col=='w' and board_state[mv[0]+'3']=='  ') or (self.col=='b' and board_state[mv[0]+'6']=='  ')):
                rez.append(('m',mv,mv))
        for mv in preliminary['t']:
            if board_state[mv][0]==oppcol:
                if pdesignation=='':
                    pdesignation = self.sq[0]
                rez.append(('t',mv,pdesignation+capture_sign+mv))
        for mv in preliminary['p']:
            if board_state[mv[:2]]=='  ':
                rez.append(('p',mv[:2],mv))
        for mv in preliminary['+']:
            if board_state[mv[:2]][0]==oppcol:
                if pdesignation=='':
                    pdesignation = self.sq[0]
                rez.append(('+',mv[:2],pdesignation+capture_sign+mv))
        for mv in preliminary['e']:
            if board_state[mv]=='  ' and board_state[mv[0]+self.sq[1]]==oppcol+'p':
                pdesignation = self.sq[0]
                rez.append(('e',mv,pdesignation+capture_sign+mv))
        for mv in preliminary['c']:
            if board_state[mv]=='  ':
                if mv[0]=='g':
                    if board_state['f'+self.sq[1]]=='  ' and board_state['g'+self.sq[1]]=='  ' and board_state['h'+self.sq[1]]== self.col+'r':
                        rez.append(('c',mv,'O-O'))
                else:
                    if board_state['b'+self.sq[1]]=='  ' and board_state['c'+self.sq[1]]=='  ' and board_state['d'+self.sq[1]]=='  ' and board_state['a'+self.sq[1]]== self.col+'r':
                        rez.append(('c',mv,'O-O-O'))
        for direct in ['NE','SE','SW','NW','N','E','S','W']:
            for mv in preliminary[direct]:
                if board_state[mv]=='  ':
                    rez.append(('m',mv,pdesignation+mv))
                else:
                    if board_state[mv][0]==oppcol:
                        rez.append(('t',mv,pdesignation+capture_sign+mv))
                    break

        return rez                
